import React from "react";

class Tab extends React.Component {
    render() {

        let {title, current, previous} = this.props;

        return (
            <div className='dashboard'>
                <div className='data'>
                    <h2>{title} hello</h2>
                    <h3>{current}</h3>
                    <p>{previous}</p>
                </div>
            </div>
        );
    }
};

export default Tab;
